--
-- Name: fetch_usd_ngn_exchange_rate(timestamp without time zone); Type: FUNCTION; Schema: public; Owner: kevinsmith
--

CREATE FUNCTION public.fetch_usd_ngn_exchange_rate(timestamp without time zone) RETURNS numeric
    LANGUAGE sql
    AS $_$
      SELECT
      CAST(COALESCE(rates #>>'{USD,NGN}', rates ->>'NGN') AS decimal) AS rate
      FROM exchange_rates
      WHERE created_at <= $1
      ORDER BY created_at DESC
      LIMIT 1;
      $_$;


