--
-- Name: in_running_balances; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.in_running_balances AS
 SELECT ledger_entries.id,
    ( SELECT COALESCE(sum(irb.fractional), (0)::numeric) AS in_running_balance
           FROM public.ledger_entries irb
          WHERE (((irb.currency)::text = (ledger_entries.currency)::text) AND (irb.created_at <= ledger_entries.created_at) AND (irb.state = 1) AND ((irb.to_type)::text = 'Account'::text) AND (irb.to_id =
                CASE
                    WHEN ((ledger_entries.to_type)::text = 'Account'::text) THEN ledger_entries.to_id
                    ELSE ledger_entries.from_id
                END))) AS balance,
    ledger_entries.to_id,
    ledger_entries.fractional
   FROM public.ledger_entries
  ORDER BY ledger_entries.created_at;


ALTER TABLE public.in_running_balances OWNER TO kevinsmith;

--
-- Name: out_running_balances; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.out_running_balances AS
 SELECT ledger_entries.id,
    ( SELECT COALESCE(sum(orb.fractional), (0)::numeric) AS in_running_balance
           FROM public.ledger_entries orb
          WHERE (((orb.currency)::text = (ledger_entries.currency)::text) AND (orb.created_at <= ledger_entries.created_at) AND (orb.state = 1) AND ((orb.from_type)::text = 'Account'::text) AND (orb.from_id =
                CASE
                    WHEN ((ledger_entries.to_type)::text = 'Account'::text) THEN ledger_entries.to_id
                    ELSE ledger_entries.from_id
                END))) AS balance,
    ledger_entries.to_id,
    ledger_entries.fractional
   FROM public.ledger_entries
  ORDER BY ledger_entries.created_at;


ALTER TABLE public.out_running_balances OWNER TO kevinsmith;

--
-- Name: running_balances; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.running_balances AS
 SELECT ledger_entries.id,
    (in_running_balances.balance - out_running_balances.balance) AS balance
   FROM ((public.ledger_entries
     LEFT JOIN public.in_running_balances ON ((in_running_balances.id = ledger_entries.id)))
     LEFT JOIN public.out_running_balances ON ((out_running_balances.id = ledger_entries.id)))
  WHERE (((ledger_entries.to_type)::text = 'Account'::text) OR ((ledger_entries.from_type)::text = 'Account'::text));


ALTER TABLE public.running_balances OWNER TO kevinsmith;

--
-- Name: api_client_balances; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.api_client_balances AS
 SELECT apps.id AS app_id,
    apps.name AS app_name,
    account_ledger_entries.account_currency,
    COALESCE(running_balances.balance, (0)::numeric) AS account_balance
   FROM ((((public.apps
     LEFT JOIN public.api_keys ON ((api_keys.app_id = apps.id)))
     LEFT JOIN ( SELECT accounts.id AS account_id,
            accounts.api_key_id,
            accounts.currency AS account_currency,
            max(ledger_entries_1.updated_at) AS last_updated_at
           FROM (public.accounts
             LEFT JOIN public.ledger_entries ledger_entries_1 ON (((accounts.id = ledger_entries_1.from_id) OR (accounts.id = ledger_entries_1.to_id))))
          GROUP BY accounts.id, accounts.api_key_id, accounts.currency) account_ledger_entries ON ((account_ledger_entries.api_key_id = api_keys.id)))
     LEFT JOIN public.ledger_entries ON ((((account_ledger_entries.account_id = ledger_entries.from_id) OR (account_ledger_entries.account_id = ledger_entries.to_id)) AND (ledger_entries.updated_at = account_ledger_entries.last_updated_at))))
     LEFT JOIN public.running_balances ON ((running_balances.id = ledger_entries.id)));


ALTER TABLE public.api_client_balances OWNER TO kevinsmith;

