    COALESCE((senders.details ->> 'name'::text), concat_ws(' '::text, (senders.details ->> 'first_name'::text), (senders.details ->> 'last_name'::text))) AS sender_name,
    (senders.details ->> 'email'::text) AS email
   FROM public.senders;


