--
-- Name: transaction_request_data; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.transaction_request_data AS
 SELECT transaction_requests.id,
        CASE
            WHEN (( SELECT count(*) AS count
               FROM jsonb_object_keys(transaction_requests.overrides) jsonb_object_keys(jsonb_object_keys)) = 0) THEN transaction_requests.content
            ELSE transaction_requests.overrides
        END AS data
   FROM public.transaction_requests;


ALTER TABLE public.transaction_request_data OWNER TO kevinsmith;

--
-- Name: transaction_request_recipients; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.transaction_request_recipients AS
 SELECT entry.id,
    (entry.value ->> 'requested_currency'::text) AS requested_currency,
    entry.input_currency,
    ((entry.value -> 'payout_method'::text) ->> 'type'::text) AS output_currency,
    ((entry.value ->> 'requested_amount'::text))::numeric AS requested_amount,
    ((entry.value ->> 'input_amount'::text))::numeric AS input_amount,
    ((entry.value ->> 'output_amount'::text))::numeric AS output_amount,
    (entry.value ->> 'metadata'::text) AS metadata
   FROM ( SELECT transaction_requests.id,
            (trd.data ->> 'input_currency'::text) AS input_currency,
            recipients.value
           FROM (public.transaction_requests
             JOIN public.transaction_request_data trd ON ((trd.id = transaction_requests.id))),
            LATERAL jsonb_array_elements((trd.data -> 'recipients'::text)) recipients(value)) entry;


ALTER TABLE public.transaction_request_recipients OWNER TO kevinsmith;

--
-- Name: transactions_summary; Type: VIEW; Schema: public; Owner: kevinsmith
--

CREATE VIEW public.transactions_summary AS
 WITH payin_accounts AS (
         SELECT DISTINCT recipients_1.id AS recipient_id,
            external_accounts_1.name AS account_name,
            external_accounts_1.revenue_entity
           FROM (((public.ledger_entries ledger_entries_1
             LEFT JOIN public.transactions transactions_1 ON (((ledger_entries_1.to_id = transactions_1.id) AND ((ledger_entries_1.to_type)::text = 'Transaction'::text))))
             LEFT JOIN public.recipients recipients_1 ON ((recipients_1.owner_id = transactions_1.id)))
             LEFT JOIN public.external_accounts external_accounts_1 ON ((external_accounts_1.id = ledger_entries_1.external_account_id)))
        )
 SELECT transactions.id AS uuid,
    recipients.id AS recipient_id,
    senders.id AS sender_id,
    senders.type AS sender_type,
    (senders.details ->> 'country'::text) AS sender_country,
    concat(recipients.margin_input_currency, ':', "substring"((payout_methods.type)::text, 15, 3)) AS corridor,
    replace((transactions.type)::text, 'Transaction::'::text, ''::text) AS payin_currency,
    recipients.input_fractional AS payin_amount,
    "substring"(replace((payout_methods.type)::text, 'PayoutMethod::'::text, ''::text), 1, 3) AS payout_currency,
    COALESCE(NULLIF("substring"(replace((payout_methods.type)::text, 'PayoutMethod::'::text, ''::text), 6), ''::text), 'BTC'::text) AS payout_corridor,
    recipients.output_fractional AS payout_amount,
    transactions.state AS transaction_state,
    transactions.created_at AS time_started,
    ledger_entries.finished_at AS time_paid_out,
    transactions.payin_reference AS payin_number_reference,
    COALESCE(concat_ws(','::text, ledger_entries.reference), ''::text) AS payout_number_reference,
        CASE
            WHEN ((transactions.type)::text = 'Transaction::BTC'::text) THEN transactions.payin_reference
            WHEN ((payout_methods.type)::text = 'PayoutMethod::BTC'::text) THEN ("substring"((payout_methods.details ->> 'address'::text), '[0-9a-zA-Z]+'::text))::character varying
            ELSE ''::character varying
        END AS managed_wallet,
    (NOT COALESCE(transactions.single, true)) AS bulk,
    transactions.otc,
    apps.name AS app_name,
    apps.id AS app_id,
    ''::text AS revenue_entity,
    payin_accounts.revenue_entity AS payin_revenue_entity,
    external_accounts.revenue_entity AS payout_revenue_entity,
    payin_accounts.account_name AS payin_account_name,
    external_accounts.name AS payout_account_name,
    recipients.payin_currency_mtm,
    ((recipients.payin_usd_fractional)::double precision / (100)::double precision) AS payin_usd_eq,
    recipients.payout_currency_mtm,
    ((recipients.payout_usd_fractional)::double precision / (100)::double precision) AS payout_usd_eq,
    ((recipients.margin_fractional)::double precision / (100)::double precision) AS fx_margin_usd,
    ((recipients.fee_usd_fractional)::double precision / (100)::double precision) AS fee_usd,
    (((recipients.margin_fractional)::double precision / (100)::double precision) + ((recipients.fee_usd_fractional)::double precision / (100)::double precision)) AS total_usd_revenue,
        CASE
            WHEN (((apps.name)::text = 'BitPesa V2'::text) AND (((recipients.margin_input_currency)::text = 'BTC'::text) OR ((transactions.type)::text = 'Transaction::BTC'::text))) THEN 'BitPesa'::text
            WHEN (((apps.name)::text = 'BitPesa V2'::text) AND (((recipients.margin_input_currency)::text <> 'BTC'::text) OR ((transactions.type)::text <> 'Transaction::BTC'::text))) THEN 'BFX'::text
            ELSE 'TransferZero'::text
        END AS product,
    COALESCE((recipients.metadata ->> 'provider_code'::text), (payout_methods.provider_code)::text) AS payout_partner,
        CASE
            WHEN ((payout_methods.type)::text = 'PayoutMethod::NGN::Bank'::text) THEN (bank_codes.name)::text
            ELSE (payout_methods.details ->> 'bank_name'::text)
        END AS bank_name,
    upper("substring"(btrim((payout_methods.details ->> 'iban'::text)), 1, 2)) AS payout_country
   FROM (((((((((public.recipients
     JOIN public.transactions ON ((transactions.id = recipients.owner_id)))
     JOIN public.senders ON ((senders.id = transactions.sender_id)))
     JOIN public.payout_methods ON ((payout_methods.id = recipients.payout_method_id)))
     JOIN public.api_keys ON ((api_keys.id = transactions.api_key_id)))
     JOIN public.apps ON ((apps.id = api_keys.app_id)))
     LEFT JOIN public.ledger_entries ON (((ledger_entries.to_id = recipients.id) AND ((ledger_entries.to_type)::text = 'Recipient'::text) AND (ledger_entries.state <> 2))))
     LEFT JOIN payin_accounts ON ((payin_accounts.recipient_id = recipients.id)))
     LEFT JOIN public.external_accounts ON ((external_accounts.id = ledger_entries.external_account_id)))
     LEFT JOIN public.bank_codes ON ((("substring"(replace((payout_methods.type)::text, 'PayoutMethod::'::text, ''::text), 1, 3) = (bank_codes.currency)::text) AND ((payout_methods.details ->> 'bank_code'::text) = (bank_codes.code)::text) AND (COALESCE(NULLIF("substring"(replace((payout_methods.type)::text, 'PayoutMethod::'::text, ''::text), 6), ''::text), 'BTC'::text) = 'Bank'::text))));


