--
-- Name: senders_summary _RETURN; Type: RULE; Schema: public; Owner: kevinsmith
--

CREATE OR REPLACE VIEW public.senders_summary AS
 SELECT senders.id AS uuid,
    replace((senders.type)::text, 'Sender::'::text, ''::text) AS sender_type,
    (senders.details ->> 'name'::text) AS business_name,
    (senders.details ->> 'city'::text) AS city,
    (senders.details ->> 'country'::text) AS country,
    senders.state AS sender_state,
        CASE
            WHEN (senders.state = 0) THEN 'initial'::text
            WHEN (senders.state = 1) THEN 'verified'::text
            WHEN (senders.state = 2) THEN 'approved'::text
            WHEN (senders.state = 3) THEN 'banned'::text
            WHEN (senders.state = 4) THEN 'rejected'::text
            WHEN (senders.state = 5) THEN 'disabled'::text
            ELSE NULL::text
        END AS state_text,
    max(documents.created_at) AS documents_last_uploaded_at,
    count(transactions.id) AS transaction_count,
    (sum(ledger_entries.fractional) / (100)::numeric) AS transaction_volume,
    max((ledger_entries.currency)::text) AS transaction_currency,
    min(transactions.created_at) AS first_transaction_date,
    max(transactions.created_at) AS last_transaction_date
   FROM ((((public.senders
     LEFT JOIN public.transactions ON (((transactions.sender_id = senders.id) AND (transactions.state = 5))))
     LEFT JOIN public.ledger_entries ON (((ledger_entries.from_id = transactions.id) AND (ledger_entries.state = 1) AND ((ledger_entries.to_type)::text = 'Recipient'::text) AND ((ledger_entries.from_type)::text = 'Transaction'::text))))
     LEFT JOIN public.sender_documents ON ((sender_documents.sender_id = senders.id)))
     LEFT JOIN public.documents ON ((documents.id = sender_documents.document_id)))
  GROUP BY senders.id;


